import React from 'react';
import Avatar from '../../assets/img/avatarsmall.jpg'

function About() {
    return (
        <article className='about-contain'>
            <img src={Avatar} className="avatar" alt="Hank Mamallian Snoopicus the Beagle, the codeclast mascot" />
            <div className='textbox'>
                <h3>This is H.M.Snoopicus Beagle, our Mascot.</h3>
                Like us, Snoop is a pragmatic idealist who thinks that the world can change, but only if we are willing to do the work.<br></br><br></br>
                The advent of blockchain technologies and W3 ideas bring promises of new paradigms in tech, engineering, design and human interaction, but the quality of these new paradigms will depend dearly on the honesty and integrity of those of us who write the technologies at the outset. We intend to bring the sort of integrity and diligence that will inform a better a better world to come.<br></br><br></br>
                This all may sound like abstract and haugty language for a tech platform, but our moral center is what drives us to code in the first place, and it should inform the nature of our code as we type it. Also, it's our polite way of saying that we are very expensive, and we don't do hack work for people we don't like.<br></br><br></br>
                Snoop is a very good boy and we will not sully his good name.<br></br><br></br>
            </div>
        </article>
    )
};

export default About;
